export const GridGeometry = (size: number) => {
  const output = {
    positions: [] as [number, number, number][],
    texCoords: [] as [number, number][],
    indices: [] as number[],
  };

  // Generate grid vertices
  for (let i = 0; i <= size; i++) {
    for (let j = 0; j <= size; j++) {
      let x = -size / 2 + i;
      let z = -size / 2 + j;
      output.positions.push([x, 0, z]);
      output.texCoords.push([i / size, j / size]);
    }
  }

  // Generate grid indices for lines
  for (let i = 0; i <= size; i++) {
    for (let j = 0; j <= size; j++) {
      let current = i * (size + 1) + j;

      // Connect horizontally
      if (j < size) {
        let nextHorizontal = current + 1;
        output.indices.push(current, nextHorizontal);
      }

      // Connect vertically
      if (i < size) {
        let nextVertical = current + size + 1;
        output.indices.push(current, nextVertical);
      }
    }
  }

  return output;
};


